function calVP(){
	document.getElementById("vs").style.display ="block";
	document.getElementById("cuadro").style.display = "block";
	document.getElementById("cuo").innerHTML = "";
	hoy = new Date();
	dd = hoy.getDate();
	mm = hoy.getMonth()+1;
	yyyy = hoy.getFullYear();
	//Calcular n
	var pp = document.getElementById("plazo").value;
	pp = parseFloat(pp[0]+pp[1]+pp[2]+"");
	var periodo = document.getElementById("peri").value;
	if(periodo == "Bimestral"){
		n = pp/2;
	} else {
		if(periodo == "Trimestral"){
			n = pp/3;
		} else {
			n = pp;
		}
	}
	//Cuadro de amortización (CuotaFija o PeriodoGracia)
	if(glob == 0){
		calcularCF();
	} else {
		var gg = document.getElementById("perGra").value;
		gg = parseFloat(gg[0]+gg[1]+"");
		if(periodo == "Bimestral"){
			pg = gg/2;
		} else {
			if(periodo == "Trimestral"){
				pg = gg/3;
			} else {
				pg = gg;
			}
		}
		n = n-pg;
		
		calcularPG();
	}

}

