function interes(m){
	return m*(ipa/100);
}

function fixNumber(num){
	num = num+"";
	var a = num.indexOf(".");
	if(a==-1){
		var b ="";
		var k =0;
		for (var i = num.length - 1; i >= 0; i--) {
			k++;
			b = monto[i]+b;
			if(k==3 && i!=0){
				k=0;
				b = "."+b;
			}
		}
		return b;
	} else {
		num = num.replace(".",",");
		var b ="";
		var k =0;
		for (var i = a-1; i >= 0; i--) {
			k++;
			b = num[i]+b;
			if(k==3 && i!=0){
				k=0;
				b = "."+b;
			}
		}
		var p = "";
		for (var i = a; i < num.length; i++) {
			p+=num[i];
		}
		return b+p;
	}
}

function quitarPunto(num){
	for (var i = 0; i < num.length; i++) {
		num.replace(".","");
	}
	return num;
}

